INSERT INTO `cji_tipoalerta` VALUES (1, 'A-01', 'LANZAMIENTO DE óRDENES', 'EL SISTEMA ALERTARá AL PLANIFICADOR CUANDO SEA NECESARIO ENVIAR\nLAS óRDENES A LOS PROVEEDORES O A PLANTA.', '1', '1', '2012-08-08 11:18:01', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (2, 'A-02', 'LANZAMIENTO TARDE', 'EL SISTEMA CREARá MENSAJES DE LANZAMIENTOS DE óRDENES DE COMPRA O DE\nTRABAJO QUE SEAN TARDE PARA EL PLAN.', '1', '1', '2012-08-08 11:28:16', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (3, 'A-03', 'ROTURA DE STOCK', 'CUANDO NO HAYA INVENTARIO DISPONIBLE EN CUALQUIER PUNTO DE VENTA O EN LA PLANTA SE CREARá ESTE MENSAJE Y OTROS RELACIONADOS CON RECOMENDACIONES.', '1', '1', '2012-08-17 13:31:51', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (4, 'A-04', 'PELIGRO DE ROTURA DE STOCK', 'CUANDO LA DEMANDA REAL (VENTAS) SEA MAYOR A LA DEMANDA PLANIFICADA SE MOSTRARA ESTE MENSAJE. ESTA DIFERENCIA SE CONTROLARá POR MEDIO DE PARáMETROS PARA QUE LOS MENSAJES NO SEAN EXCESIVOS. ', '1', '1', '2012-08-17 13:32:19', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (5, 'A-05', 'EXCESO DE INVENTARIO', 'CUANDO LA DEMANDA PLANIFICADA SEA MAYOR A LA DEMANDA REAL (VENTAS) SE MOSTRARA ESTE MENSAJE. ESTA DIFERENCIA SE CONTROLARá POR MEDIO DE PARáMETROS PARA QUE LOS MENSAJES NO SEAN EN EXCESO.', '1', '1', '2012-08-17 13:32:42', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (6, 'A-06', 'INVENTARIO POR DEBAJO DEL STOCK DE SEGURIDAD', 'CADA SKU TIENE SU STOCK DE SEGURIDAD DEFINIDO EN SUS PARáMETROS, CUANDO SE TENGA ESTA INFORMACIóN SE MOSTRARá EL MENSAJE.', '1', '1', '2012-08-17 13:33:46', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (7, 'A-07', 'SKU SIN MOVIMIENTO / BAJA ROTACIóN', 'SE CREARáN ALGORITMOS PARA CONTROLAR LA ROTACIóN DE LOS SKU', '1', '1', '2012-08-17 13:34:11', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (8, 'A-08', 'ADELANTAR ORDENES PLANIFICAS', 'CON UN MODELO MATEMáTICO SE CREARáN MENSAJES PARA OPTIMIZAR LA PLANIFICACIóN DE LAS ORDENES PLANIFICADAS CONFIRMADAS Y REALES.', '1', '1', '2012-08-17 13:34:35', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (9, 'A-09', 'RETRAZAR ORDENES PLANIFICADAS', 'CON UN MODELO MATEMáTICO SE CREARáN MENSAJES PARA OPTIMIZAR LA PLANIFICACIóN DE LAS ORDENES PLANIFICADAS CONFIRMADAS Y REALES.', '1', '1', '2012-08-17 13:34:55', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (10, 'A-10', 'TAMAñO DE LOTE DIFERENTE AL PLANIFICADO', 'SE DETECTARáN ERRORES EN LA PLANIFICACIóN COMO EL CASO DE CANTIDADES DIFERENTES A LAS PLANIFICADAS', '1', '1', '2012-08-17 13:35:23', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (11, 'A-11', 'DEMANDA PLANIFICADA DIFERENTE AL REAL', 'SE CONTROLARá DIARIAMENTE POR MEDIO DE UN ALGORITMO EL AVANCE DE LAS VENTAS REALES VERSUS LAS PLANIFICADAS', '1', '1', '2012-08-17 13:35:43', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (12, 'A-12', 'CAMBIO DE CLASIFICACIóN ABC', 'CUANDO UN SKU CAMBIE SU CLASIFICACIóN SE MOSTRARá ESTE MENSAJE.', '1', '1', '2012-08-17 13:36:01', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (13, 'A-13', 'CANCELAR ORDENES PLANIFICADAS', 'SE MOSTRARá ESTE MENSAJE EN LOS CASOS DONDE NO SEA NECESARIO LA RECEPCIóN DE ESTAS CANTIDADES.', '1', '1', '2012-08-17 13:36:32', NULL, 2);
INSERT INTO `cji_tipoalerta` VALUES (14, 'A-14', 'CANCELAR ORDENES REALES', 'SE MOSTRARá ESTE MENSAJE EN LOS CASOS DONDE NO SEA NECESARIO LA RECEPCIóN DE ESTAS CANTIDADES.', '1', '1', '2012-08-17 13:36:48', NULL, 2);
